import { WebClient } from "@slack/web-api";
import { PrismaClient } from "@prisma/client";

import { emojiFor } from "../pokemon";
import { MentionEvent } from "../slack";
import { Responder } from "./";

export default {
  id: "help",
  triggerPhrase: "Help",
  respond: async (
    event: MentionEvent,
    client: WebClient,
    prisma: PrismaClient
  ) => {
    await prisma.roll
      .findMany({
        where: { userId: event.user },
        include: { Pokemon: true },
      })
      .then((r) => r.forEach(() => {}));
  },
} as Responder;
